-module(fix_engine_field_sup).

-behaviour(supervisor).

%% API.
-export([start_link/0]).

%% supervisor.
-export([init/1]).

-include("fix.hrl").

-spec start_link() -> {ok, pid()}.
start_link() ->
        supervisor:start_link({local, ?MODULE}, ?MODULE, []).

init([]) ->
        fix_engine_field = ets:new(fix_engine_field, [ordered_set, protected, {keypos, #fix_field.id}]),
        populate_fix_fields(),
        Procs = [
                {fix_engine_field, {fix_engine_field, start_link, []},
                permanent, 5000, worker, [fix_engine_field]}
        ],
        {ok, {{one_for_one, 5, 10}, Procs}}.


